import "@openzeppelin/contracts/proxy/Clones.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

import "./implementations/Song.sol";
import "./implementations/StakePool.sol";
import "./implementations/ArtistsPool.sol";
import "./bops/BopLevelsHandler.sol";
import "./Structs.sol";

/**
 * @title Songs Manager Contract
 * @author Eric Nordelo
 */
contract SongsManager is BopLevelsHandler, Initializable {
    bytes32 public constant SONG_CONTRACT = keccak256("SONG_CONTRACT");
    bytes32 public constant VERIFIER = keccak256("VERIFIER");

    using Counters for Counters.Counter;

    Counters.Counter private _songIds;

    mapping(uint256 => bytes32[]) private _songArtistsIds;

    mapping(uint256 => RegisteredSong) public registeredSongs;
    mapping(bytes32 => uint256) public songCIDtoId;

    address private _songAddr;
    address private _stakePoolAddr;
    address private _artistsPoolAddr;
    address private _fundsManagerAddress;
    address private _bopTokenAddress;

    /**
     * @dev event emitted after song registration with the id and proxy addresses
     */
    event RegisterSong(uint256 indexed songId, address song, address stakePool, address artistsPool);

    /**
     * @notice Initialize the positions for staking and the addresses of implementations and tokens
     */
    //  solhint-disable-next-line
    constructor(BopLevel[] memory _levels) BopLevelsHandler(_levels) {}

    /**
     * @dev sets the contracts where SONG_CONTRACT role should be given
     * @param fundsManagerAddress the FundsManager contract
     * @param bopTokenAddress the BopToken contract
     */
    function initialize(
        address fundsManagerAddress,
        address bopTokenAddress,
        address songAddr,
        address stakePoolAddr,
        address artistsPoolAddr
    ) external initializer {
        _fundsManagerAddress = fundsManagerAddress;
        _bopTokenAddress = bopTokenAddress;
        _songAddr = songAddr;
        _stakePoolAddr = stakePoolAddr;
        _artistsPoolAddr = artistsPoolAddr;
    }

    /**
     * @notice register a song on the contract (unverified)
     * @param _cid the IPFS hash identifying the song file
     * @param _genre the genre of the song
     * @param _artists the list of artist ids (keccak256 of the identificators like Country + DNI)
     */
    function registerSong(
        string calldata _cid,
        string calldata _genre,
        bytes32[] calldata _artists
    ) external {
        _songIds.increment();
        uint256 songId = _songIds.current();

        // deploy the song contracts and initialize them
        // deploys minimal proxy contracts from implementation
        address newSong = Clones.clone(_songAddr);
        Song(newSong).initialize(songId, _genre, address(this));

        address newStakePool = Clones.clone(_stakePoolAddr);
        StakePool(newStakePool).initialize();

        address newArtistsPool = Clones.clone(_artistsPoolAddr);
        ArtistsPool(newArtistsPool).initialize();

        // save the artists
        _songArtistsIds[songId] = _artists;

        // save the song id from cid
        songCIDtoId[keccak256(abi.encodePacked(_cid))] = songId;

        // save the song information
        registeredSongs[songId] = RegisteredSong({
            addr: newSong,
            cid: _cid,
            verified: false,
            addresses: SongContractAddresses({stakePool: newStakePool, artistsPool: newArtistsPool})
        });

        // give the corresponding SONG_CONTRACT roles
        AccessControl(_fundsManagerAddress).grantRole(SONG_CONTRACT, newSong);
        AccessControl(_bopTokenAddress).grantRole(SONG_CONTRACT, newSong);

        emit RegisterSong(songId, newSong, newStakePool, newArtistsPool);
    }

    /**
     * @notice allows verifying a song
     * @param _songId the id of the song
     */
    function verifySong(uint256 _songId) external onlyRole(VERIFIER) {
        require(registeredSongs[_songId].addr != address(0), "Nonexistent song");
        registeredSongs[_songId].verified = true;
    }

    function isRegistered(string calldata _cid) external view returns (uint256 songId) {
        return songCIDtoId[keccak256(abi.encodePacked(_cid))];
    }

    function isVerified(uint256 _songId) external view returns (bool verified) {
        require(registeredSongs[_songId].addr != address(0), "Nonexistent song");
        return registeredSongs[_songId].verified;
    }
}

